selector_to_html = {"a[href=\"#equation-eq-lec5-ex3-sol-intervals\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec5-ex3-sol-intervals\">\n\\[\\begin{split}\n\\begin{dcases}\n1 &gt; 0 &amp; \\\\\n\\alpha + 1 &gt; 0 &amp;  \\\\\n\\frac{\\alpha^2 - 3 \\alpha}{\\alpha + 1} &gt; 0 \\quad &amp; \\text{(C)}\\\\\n4 \\alpha &gt; 0 &amp;\n\\end{dcases}\n\\end{split}\\]</div>", "a[href=\"#fig-lec5-ex3-sol-bode\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex3-sol-bode\">\n<a class=\"reference internal image-reference\" href=\"../_images/9579efb25ca29e460d42c5f3d1884988e53196989c36440421d1948de42c7208.png\"><img alt=\"../_images/9579efb25ca29e460d42c5f3d1884988e53196989c36440421d1948de42c7208.png\" src=\"../_images/9579efb25ca29e460d42c5f3d1884988e53196989c36440421d1948de42c7208.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 54 </span><span class=\"caption-text\">Magnitude Bode plot of the nominal complementary sensitivity transfer function <span class=\"math notranslate nohighlight\">\\(T(s)\\)</span>.</span><a class=\"headerlink\" href=\"#fig-lec5-ex3-sol-bode\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-4\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 4<a class=\"headerlink\" href=\"#question-4\" title=\"Link to this heading\">#</a></h3><p>There is, indeed, a difference between the solution of Question 1 (<span class=\"math notranslate nohighlight\">\\(\\alpha &gt; 3\\)</span>) and the solution of Question 3 (<span class=\"math notranslate nohighlight\">\\(\\alpha &gt; 4\\)</span>). The reason for this difference is that Criterion 6.2 is <strong>only a sufficient condition</strong>. This means that:</p>", "a[href=\"#fig-lec5-ex3-sol-comparison-2\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex3-sol-comparison-2\">\n<a class=\"reference internal image-reference\" href=\"../_images/2f57eea1777d6f50ed0e308c7100c7d154aaa33b585510fcfa8336379696a71e.png\"><img alt=\"../_images/2f57eea1777d6f50ed0e308c7100c7d154aaa33b585510fcfa8336379696a71e.png\" src=\"../_images/2f57eea1777d6f50ed0e308c7100c7d154aaa33b585510fcfa8336379696a71e.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 57 </span><span class=\"caption-text\">Comparison between the nominal complementary sensitivity <span class=\"math notranslate nohighlight\">\\(\\lvert T(i \\omega) \\lvert_{\\text{dB}}\\)</span> and  <span class=\"math notranslate nohighlight\">\\(-\\lvert \\Delta(i \\omega) \\lvert_{\\text{dB}}\\)</span> for <span class=\"math notranslate nohighlight\">\\(\\alpha=4\\)</span>.</span><a class=\"headerlink\" href=\"#fig-lec5-ex3-sol-comparison-2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>To compute the real closed-loop transfer function, we start by computing the real open-loop one:</p>", "a[href=\"#fig-lec5-ex3-sol-delta-bode\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex3-sol-delta-bode\">\n<a class=\"reference internal image-reference\" href=\"../_images/89956088136ab2d8d9d86a6bb89ada54988b2c043b207322ecc627c8e2d51e1d.png\"><img alt=\"../_images/89956088136ab2d8d9d86a6bb89ada54988b2c043b207322ecc627c8e2d51e1d.png\" src=\"../_images/89956088136ab2d8d9d86a6bb89ada54988b2c043b207322ecc627c8e2d51e1d.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 55 </span><span class=\"caption-text\">Asymoptotic magnitude plot of <span class=\"math notranslate nohighlight\">\\(\\Delta(s)\\)</span> for several values of <span class=\"math notranslate nohighlight\">\\(\\alpha\\)</span>.</span><a class=\"headerlink\" href=\"#fig-lec5-ex3-sol-delta-bode\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-3\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3<a class=\"headerlink\" href=\"#question-3\" title=\"Link to this heading\">#</a></h3><p>To apply the Robustness Criterion, we need to plot <span class=\"math notranslate nohighlight\">\\(\\lvert \\Delta(i \\omega) \\lvert_{\\text{dB}}\\)</span> and then mirror it with respect to the 0dB axis to get <span class=\"math notranslate nohighlight\">\\(-\\lvert \\Delta(i \\omega) \\lvert_{\\text{dB}}\\)</span>.</p><p>The (asymptotic) Bode plot we note that</p>", "a[href=\"#fig-lec5-ex3-sol-comparison-1\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex3-sol-comparison-1\">\n<a class=\"reference internal image-reference\" href=\"../_images/12e8775322cf566595e2034e1cab94171798e821944263024ec27f2e97070a9c.png\"><img alt=\"../_images/12e8775322cf566595e2034e1cab94171798e821944263024ec27f2e97070a9c.png\" src=\"../_images/12e8775322cf566595e2034e1cab94171798e821944263024ec27f2e97070a9c.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 56 </span><span class=\"caption-text\">Comparison between the nominal complementary sensitivity <span class=\"math notranslate nohighlight\">\\(\\lvert T(i \\omega) \\lvert_{\\text{dB}}\\)</span> and  <span class=\"math notranslate nohighlight\">\\(-\\lvert \\Delta(i \\omega) \\lvert_{\\text{dB}}\\)</span></span><a class=\"headerlink\" href=\"#fig-lec5-ex3-sol-comparison-1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>The multiplicative uncertainty <span class=\"math notranslate nohighlight\">\\(\\Delta(s)\\)</span> is such that</p>", "a[href=\"#fig-lec5-ex3-sol-block\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex3-sol-block\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex2-block.svg\"><img alt=\"../_images/ex2-block.svg\" src=\"../_images/ex2-block.svg\" style=\"width: 600px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 53 </span><span class=\"caption-text\">Block diagram of the control system</span><a class=\"headerlink\" href=\"#fig-lec5-ex3-sol-block\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#solutions-of-exercise-5-3\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 5.3<a class=\"headerlink\" href=\"#solutions-of-exercise-5-3\" title=\"Link to this heading\">#</a></h1><p>The proportional feedback controller <span class=\"math notranslate nohighlight\">\\(F(s) = 4\\)</span> was designed assuming that the system <span class=\"math notranslate nohighlight\">\\(G^0(s)\\)</span> was identical to the model, <span class=\"math notranslate nohighlight\">\\(G(s) = \\frac{1}{s(s+1)}\\)</span>.</p><p>The real system, however, is</p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>To compute the real closed-loop transfer function, we start by computing the real open-loop one:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
